import React, {useEffect, useState} from 'react'
import {Table} from 'antd'
const TableList = ({title}) => {
  const columns = [
    {
      title: '产品名称',
      dataIndex: '',
      key: '',
      width: 120,
    },
    {
      title: '授信金额(元)',
      dataIndex: '',
      key: '',
      width: 150,
    },
    {
      title: '用信金额(元)',
      dataIndex: '',
      key: '',
      width: 150,
    },
    {
      title: '用信余额(元)',
      dataIndex: '',
      key: '',
      width: 150,
    },
    {
      title: '申请笔数(笔)',
      dataIndex: '',
      key: '',
      width: 150,
    },
    {
      title: '授信笔数(笔)',
      dataIndex: '',
      key: '',
      width: 150,
    },
    {
      title: '用信笔数(笔)',
      dataIndex: '',
      key: '',
      width: 150,
    },
  ]

  return (
    <Table
      rowKey={(record) => record.id}
      dataSource={title}
      columns={columns}
      // bordered
      style={{width: '100%', marginTop: '20px'}}
    />
  )
}

export default TableList
